(23932, 'Мраморная лестница, огороженная эксклюзивными коваными перилами, соединяет все четыре этажа гостиницы. Причудливое переплетение растительных элементов, стеблей и ростков делает лестницу настоящим предметом в стиле ар нуво. Спустившись по этой удивительно красивой лестнице на первый этаж, можно посетить небольшой, но уютный ресторан, предлагающий изысканные блюда европейской кухни. В двух залах – теплые полы, так что посетителям здесь всегда тепло и комфортно. Для гостей отеля предусмотрены скидки. Интерьер ресторана выдержан в той же самой цветовой гамме, что и вся гостиница. Замечательная кухня, безукоризненное обслуживание надолго запомнятся всем посетителям.', 20, 1449),
