(24306, 'Кофейня «Эгоист» — это мечта, точка пересечения модной публики города. Актуальное место, которое расположено в самом центре города Караганды.Уютная кофейня, расположенная на 2-х этажах, шикарно обставлена и выдержана в едином стиле. Удобные маленькие диванчики, которые так и манят, как бы безмолвно приглашая опуститься на них и отдыхать душой и телом. Лучшие бариста города приготовят специально для вас великолепный кофе, ведь для приготовления этого напитка используют все только самое лучшее. Специально отобранная смесь зерен арабики свежей обжарки, тщательная настройка оборудования, - все это дает потрясающий результат, которым мы гордимся!', 20, 1471),
